### JavaScript

```javascript
"use strict";

const re = require('re');

function f_gold(word) {
    const nums = word.split(/[a-z]+/);
    const numSet = new Set();
    for (let num of nums) {
        if (num !== '') {
            numSet.add(parseInt(num));
        }
    }
    return numSet.size;
}
